Ext.data.JsonP['ACS_1.1.10_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>ACS 1.1.10 - 22 March 2015</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-50725315\" class=\"content\">\n                        <h1>ACS 1.1.10 - 22 March 2015</h1>\n    <div class=\"section section-2 \" id=\"src-50725315_ACS1.1.10ReleaseNote-Bugfix\">\n        <h2 class=\"heading \"><span>Bug fix</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed an issue where updating a custom object with invalid fields would return a 500 error code instead of a 400 error code    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50725315\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"ACS 1.1.10 Release Note"});